import React from 'react';
import logo from './logo.svg';
import './App.css';
import LoginComponent from "./Modules/Login/LoginComponent";


function App() {
  return (
    <div className="App">
      <header className="App-header">        
        <p>
          PantryTrak frontend loaded successfully.
        </p>
            <LoginComponent/>
      </header>
    </div>
  );
}
export default App;
